text:
@katarinabarley und die @spdde gehen mit starkem Programm und klarem Fokus gegen Steuertricksereien, für Digitalsteuer und gerechte Körperschaftssteuern an den Start.
Unternehmen müssen ihren Anteil für die solidarische Gesellschaft leisten!
#EuropaIstDieAntwort #EuropeUnited

